import React from 'react';
import TitleArticle from './page/cards/title';
import Meta from './page/cards/meta';
import Content from './page/cards/content';
import Actions from './page/cards/actions';
import CommentForm from './page/cards/commentForm';


//import Navbar from '../nav/navbar';
//import NavbarMobile from '../nav/navbarMobile';
//import Footer from '../footer/footer'; 




export default function Article() {
    return (
        <>
            {/* <Navbar /> */}
            {/* <MobileHomeHeader /> */}

            <div class="article-page">

                <div class="banner">
                    <div class="container">

                        <TitleArticle />
                        <Meta />

                    </div>
                </div>

                <div class="container page">

                    <Content />


                    <hr />

                    <Actions />

                    <div class="row">

                        <div class="col-xs-12 col-md-8 offset-md-2">

                            <CommentForm />

                            <div class="card">
                                <div class="card-block">
                                    <p class="card-text">With supporting text below as a natural lead-in to additional content.</p>
                                </div>
                                <div class="card-footer">
                                    <a href="" class="comment-author">
                                        <img src="http://i.imgur.com/Qr71crq.jpg" class="comment-author-img" />
                                    </a>
            &nbsp;
            <a href="" class="comment-author">Jacob Schmidt</a>
                                    <span class="date-posted">Dec 29th</span>
                                </div>
                            </div>

                            <div class="card">
                                <div class="card-block">
                                    <p class="card-text">With supporting text below as a natural lead-in to additional content.</p>
                                </div>
                                <div class="card-footer">
                                    <a href="" class="comment-author">
                                        <img src="http://i.imgur.com/Qr71crq.jpg" class="comment-author-img" />
                                    </a>
            &nbsp;
            <a href="" class="comment-author">Jacob Schmidt</a>
                                    <span class="date-posted">Dec 29th</span>
                                    <span class="mod-options">
                                        <i class="ion-edit"></i>
                                        <i class="ion-trash-a"></i>
                                    </span>
                                </div>
                            </div>

                        </div>

                    </div>

                </div>

            </div>


            {/* <NavbarMobile /> */}


        </>

    );
}
